// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./ERC721r.sol";

contract MetaLifeHealingDrone is ReentrancyGuard, Ownable, ERC721r {

    using Strings for uint256;
    string public baseURI;

    uint256 public limitMint = 0;
    address payable private collector;

    mapping(address => uint8) private eligibilities;
    event Minted(address indexed from, uint256 timestamp);

    constructor() ERC721r('Meta-Life Healing Drone', 'MLH', 54_32){
        limitMint = 1719784799;
    }

    function withdrawAll() public payable onlyOwner {
        collector.transfer(address(this).balance);
    }

    function setCollector(address payable _newCollector) public onlyOwner {
        // GMT Sunday 30 June 2024 21:59:59
        collector = _newCollector;
    }

    function _setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function _baseURI() internal view virtual returns (string memory) {
        return baseURI;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), 'unknow token');

        string memory uri = _baseURI();
        return bytes(uri).length > 0 ? string(abi.encodePacked(uri, tokenId.toString())) : "";
    }

    function addEligibilities(address[] calldata _addresses, uint8[] calldata _quantities) external onlyOwner {
        require(_addresses.length == _quantities.length, 'Nb address and nb quantities must be equal');
        for (uint i = 0; i < _addresses.length; i++) {
            eligibilities[_addresses[i]] = _quantities[i];
        }
    }

    function addressEligible(address _wallet) public view returns(uint8) {
        return eligibilities[_wallet];
    }

    function mint(uint8 _nb) external {
        require(block.timestamp < limitMint, "Healing drone mint close");
        require(eligibilities[msg.sender] > 0, "Not eligible");
        require(eligibilities[msg.sender] >= _nb, "Not enough claimable tokens");
        require(maxSupply >= totalSupply() + _nb, "Supply limit exceed");

        eligibilities[msg.sender] = eligibilities[msg.sender] - _nb;
        _mintRandom(msg.sender, _nb);
        emit Minted(msg.sender, block.timestamp);
    }

    function tokenExist(uint256 tokenId) public view returns(bool) {
        return _exists(tokenId);
    }
}
